import React, { useState } from 'react';

function Board() {
  const [turn, setTurn] = useState(0);
  const changeTurn = () => {
    if(turn <= 0){
      setTurn(turn + 1);
    } else {
      setTurn(turn -1);
    }
  }
  
  return (
    <div className="container-sm w-50">
        <div className="row">
          <div className="col cell text-center">
            <div className="input input-1" onClick={() => changeTurn()}>{turn}</div>
          </div>
          <div className="col cell">
            <div className="input input-1" onClick={() => changeTurn()}>{turn}</div>
          </div>
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
        </div>
        <div className="row">
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
          <div className="col cell">
            <div className="input input-1"  onClick={(e) => draw(e, 1)}></div>
          </div>
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
        </div>
        <div className="row">
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
          <div className="col cell">
            <div className="input input-1" onClick={(e) => draw(e, 1)}></div>
          </div>
        </div>
        
    </div>
  );
  
}

export default Board;
